import styles from './SoundMenu.module.scss';
import className from 'classnames/bind';

import Button from '../Button';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faAngleLeft, faAngleRight, faCloudBolt, faCrow, faFrog, faWind } from '@fortawesome/free-solid-svg-icons';

const cx = className.bind(styles);

function SoundMenu() {
    return (
        <div className={cx('sidebar')}>
            <Button icon>
                <FontAwesomeIcon icon={faAngleLeft} />
            </Button>
            <div className={cx('list-sound')}>
                <Button>
                    <FontAwesomeIcon icon={faCloudBolt} />
                </Button>
                <Button>
                    <FontAwesomeIcon icon={faWind} />
                </Button>
                <Button>
                    <FontAwesomeIcon icon={faFrog} />
                </Button>
                <Button>
                    <FontAwesomeIcon icon={faCrow} />
                </Button>
            </div>
            <Button icon>
                <FontAwesomeIcon icon={faAngleRight} />
            </Button>
        </div>
    );
}

export default SoundMenu;
